import React, { useEffect } from 'react'
import { Row, Col } from 'antd'
import Nav from '../component/Nav'
import Content from '../component/Content'
import { useDispatch, useSelector } from 'react-redux'
import { GET_ALL_STORE_AND_PRODUCT_SAGA, GET_ALL_STORE_SAGA } from '../redux/type/StoreType'

export default function IndexPage() {

    const dispatch = useDispatch()
    const { listStore, listStoreAndProduct } = useSelector(state => state.storeReducer)

    useEffect(() => {
        localStorage.setItem('store', JSON.stringify({ "id": 1, "name": "Ding Tea", "createdAt": "2023-01-13T00:22:25.000Z", "updatedAt": "2023-01-17T15:55:09.000Z" }))
        localStorage.setItem('productOfStore', JSON.stringify([{ "id": 1, "name": "Royal Milk Tea", "price": 5, "toppings": "Milk foam,white pearl", "createdAt": "2023-01-13T00:22:25.000Z", "updatedAt": "2023-01-17T15:55:09.000Z" }, { "id": 2, "name": "Green Milk Tea", "price": 5, "toppings": "pearl", "createdAt": "2023-01-13T00:22:25.000Z", "updatedAt": "2023-01-17T15:55:09.000Z" }, { "id": 3, "name": "Oolong Milk Tea", "price": 5, "toppings": "Pearl, milk foam", "createdAt": "2023-01-13T00:22:25.000Z", "updatedAt": "2023-01-17T15:55:09.000Z" }, { "id": 1, "name": "Royal Milk Tea", "price": 5, "toppings": "Milk foam,white pearl", "createdAt": "2023-01-13T00:22:25.000Z", "updatedAt": "2023-01-17T15:55:09.000Z" }, { "id": 4, "name": "Blueberry Milk Tea", "price": 5, "toppings": "Pearl, milk foam", "createdAt": "2023-01-13T00:22:25.000Z", "updatedAt": "2023-01-17T15:55:09.000Z" }]))
    }, [])

    return (
        <div>
            <Row>
                <Col span={5}>
                    <Nav />
                </Col>
                <Col span={19}>
                    <Content />
                </Col>
            </Row>

        </div>
    )
}
